    return (
        <div>
            <h1>Item Details</h1>
            {/* Assuming you have a way to display item details here */}
            <ReviewsDisplay itemId={itemId} />
            <ReviewForm itemId={itemId} />
        </div>
    );
}

export default ItemDetail;
